	(62644194,'Beau-Solomon-Death-Italian-Charged-With-U.S.-Student-s-Murder','mopovu/Beau-Solomon-Death-Italian-Charged-With-U.S.-Student-s-Murder',20301882,'https://github.com/mopovu/Beau-Solomon-Death-Italian-Charged-With-U.S.-Student-s-Murder','ROME  A homeless man was charged with murder Tuesday in connection with the death of U.S. college student Beau Solomon, who vanished just hours after arriving in the Italian capital last week.   The 19-year-old sophomore  who had beat childhood cancer  was due to study at John Cabot University, a small Rome-based liberal arts college.  Solomon`s body was found in the Tiber River on Monday.  The visiting student from the University of Wisconsin-Madison was last seen around 1 a.m. on Friday (7 p.m. ET Thursday) while at a pub in Rome. He had arrived in the city only hours earlier.  Solomon`s roommate became \"worried when he did not see Beau at orientation\" later in the day, John Cabot University said in a statement issued Sunday.  Investigators identified the accused as Massimo Galioto, a 40-year-old homeless man. He was being charged with \"aggravated murder,\" a police spokesman told NBC News.  Related: Studying Abroad Can Be Deadly, Grieving Moms Warn  After the disappearance, Solomon`s parents called their son`s credit card company and \"realized thousands of dollars had been charged\" in Milan to his account, according to his brother Jake Solomon. Milan is about 350 miles north of Rome.    On Monday, another brother had told the Milwaukee Journal Sentinel that the teen`s body had been found with a head wound and blood on his shirt.  \"It`s a murder investigation,\" Cole Solomon told the newspaper before the arrest was made.  The personal finance major had been due to participate in a study abroad program. His parents arrived in Italy Monday, according to Jake Solomon. \"\"We generally feel safe, but we`ll be extra cautious now.\"\"  U.S. Ambassador to Italy John Phillips sent his condolences to Solomon`s family on Tuesday.  \"I was saddened to learn of the tragic death of Beau Solomon,\" he said in a statement. \"My heart goes out to his family and friends. The U.S. Embassy stands ready to provide support to Italian authorities investigating his disappearance and death.\"  Abby Liles, who also traveled to Rome to study at John Cabot University, told NBC News she was shocked by his death.  \"It`s very sad, especially for the family,\" the South Carolina native said. \"We generally feel safe, but we`ll be extra cautious now.\"  Back in Wisconsin, friends and family remembered Solomon as popular, outgoing and brave. \"He`s an amazing kid,\" Jake Solomon told NBC News before Beau`s body was discovered. \"Social butterfly, loved by everyone. He`s the glue that keeps our family together.\"  Cole Solomon, meanwhile, recalled his little brother`s courage during his battle against cancer.  \"He had over 15 to 20 procedures growing up throughout his life and was able to overcome all that,\" he said.  Dozens gathered at River Valley High School in Spring Green, Wisconsin, for a candlelight vigil to remember Solomon on Monday night. They lit candles and took a lap around the football field where Solomon was a quarterback, according to NBC affiliate WMTV',NULL,NULL,0,0,0,0,1,NULL,NULL,NULL,0,0,2016),
