	(187414591,'ML-et-AI-project-with-3-datasets','zie225/ML-et-AI-project-with-3-datasets',17972148,'https://github.com/zie225/ML-et-AI-project-with-3-datasets','Ce projet en 3 parties est destin  nous familiariser avec Machine Learning (ML). Les 3 parties sont comme suit:  Dans la premire partie, nous avons implmente un algorithme de slection d`attribut. tant donn un ensemble de donnes de  attributs, lalgorithme calcule simplement le rapport de gain de chacun des attributs et le conserve haut  les attributs. Cette partie devrait tre mise en uvre sur le jeu de donnes dchecs dAlen Shapiro.1 Dans ce ensemble de donnes, il y a 36 attributs, nos algorithmes ont donc choisir les 4 avec le gain le plus lev Ratio et stockez le jeu de donnes rsultant (avec seulement ces 4 attributs) dans un fichier spar.  Dans la deuxime partie, nous avons implmente lalgorithme de k-NN le plus proche pour la classification.  En utilisant la Distance euclidienne et k = 1 et nous avons appliquer notre  algorithme au Wisconsin pour le cancer du sein (diagnostic). Cependant, avant de mettre en uvre lalgorithme, nous avons divisez nos donnes en un ensemble dapprentissage et en un ensemble de test. Lensemble dentranement comprend 90% des premiers cas, alors que lensemble de test comprend des 10% restants. notre algorithme doit stocker ses prdictions dans un fichier spar et afficher la prcision de ces prdictions. Dans la dernire partie, nous avons  implmente une technique de clustering simple qui utilise deux versions de jeux de donnes du Diabte, une version discrtise et une version non discrtise (dorigine). Plus prcisment, nous utiliserons le jeu de donnes sur le diabte Indien Pima discrtis par mangrove.   Le jeu de donnes a de nombreux attributs, mais nous  nous concentrerons que sur 5 attributs non discrtiss (ge, IMC, glucose, insuline, grossesses) et 5 discrtises (LabelPAge, LabelPBMI, LabelPGlucose, LabelPInsulin, Labelpgrossesses). Ainsi la premire chose  faire est de supprimer tout sauf ces 10 attributs. Lalgorithme commence par calculer de la corrlation entre chaque paire dattributs non discrtiss et choisit le pair avec la corrlation la plus faible (c.--d., avec le coefficient de corrlation le plus proche de 0). Appelons cette paire AX et Ay. Ensuite, pour ces deux attributs, il cre un cluster pour chaque combinaison possible de valeurs pour les versions discrtises de AX et AY.  Par exemple, disons que la version discrtise de la hache a les valeurs haute et basse et la version discrtise day a les valeurs grandes et petites. Alors Il y aura les 4 clusters suivants: C1: avec des enregistrements contenant les valeurs haute et grande pour AX et AY, respectivement. C2: avec des enregistrements contenant les valeurs haute et petite pour AX et AY, respectivement. C3: avec des enregistrements contenant les valeurs basses et grandes pour AX et AY, respectivement. C4: avec des enregistrements contenant les valeurs basses et petites pour AX et AY, respectivement. Notre algorithme a du crer un fichier distinct contenant les enregistrements de chaque cluster. Elle  a galement valuer le regroupement rsultant en calculant la distance euclidienne maximale entre deux enregistrements dans le mme cluster et la distance euclidienne minimale entre deux enregistrements dans diffrents clusters. Notez que ces distances doivent tre calcules en fonction des 5 attributs non discrtiss.',NULL,'Jupyter Notebook',4,4,1,0,1,NULL,NULL,3361,0,0,2019),
