	(230006870,'ann_chiSquare','pulunghendroprastyo/ann_chiSquare',13060882,'https://github.com/pulunghendroprastyo/ann_chiSquare','Data Global Cancer Observatory 2018 dari World Health Organization (WHO) menunjukkan kasus kanker yang paling banyak terjadi di Indonesia adalah kanker payudara, yakni 58.256 kasus atau 16,7% dari total 348.809 kasus kanker. Metode Fine Needle Aspiration (FNA) merupakan metode untuk mendiagnosis kanker payudara yang saat ini paling disukai karena mudah dilakukan, aman, dan murah tetapi tingkat akurasinya masih bervariasi. Oleh sebab itu, dibutuhkan algoritme yang dapat mendiagnosis tes FNA dengan akurasi yang tinggi. Penggunaan machine learning saat ini lagi tren digunakan oleh kalangan peneliti untuk melakukan klasifikasi atau prediksi penyakit. Algoritme Artificial Neural Network (ANN) Backpropagation merupakan algoritme yang memiliki akurasi yang cukup baik tetapi memiliki waktu komputasi yang cukup lama. Penggunaan seleksi fitur untuk memilih fitur terbaik mampu meningkatkan akurasi dan mempercepat waktu komputasi. Chi-Square adalah seleksi fitur yang mampu menghilangkan fitur noise dan memilih fitur terbaik. Oleh karena itu, penelitian ini menggunakan kombinasi algoritme ANN Backpropagation dan Chi-Square untuk melakukan klasifikasi kanker payudara menggunakan Wisconsin Breast Cancer Dataset. Hasil penelitian ini menunjukkan bahwa kombinasi algoritme ANN Backpropagation dengan Chi-Square mampu melakukan klasifikasi/prediksi kanker payudara dengan sangat baik. Arsitektur atau model terbaik kombinasi ANN dengan Chi-Square yaitu 15 input layer, 1 hidden layer 10 node, dan 2 ouput layer dengan menggunakan 150 epoch. Arsitektur tersebut memiliki performa terbaik dengan nilai accuracy sebesar 96,49%, precision 100%, recall 94,36%, f1-score 97,10% dan AUC 97,18%. Penggunaan Chi-Square sebagai seleksi fitur mampu meningkatkan performa algoritme ANN Backpropagation baik dari segi akurasi maupun waktu komputasi.',NULL,'Jupyter Notebook',0,0,0,0,1,NULL,NULL,2120,0,0,2019),
