	(275631857,'Healthcare-Cost-Analysis','praveenkumarsingh662/Healthcare-Cost-Analysis',67552289,'https://github.com/praveenkumarsingh662/Healthcare-Cost-Analysis','Background and Objective:  A nationwide survey of hospital costs conducted by the US Agency for Healthcare consists of hospital records of inpatient samples. The given data is restricted to the city of Wisconsin and relates to patients in the age group 0-17 years. The agency wants to analyze the data to research on healthcare costs and their utilization.  Domain: Healthcare. Analysis to be done:   1. To record the patient statistics, the agency wants to find the age category of people who frequent the hospital and has the maximum expenditure.  2. In order of severity of the diagnosis and treatments and to find out the expensive treatments, the agency wants to find the diagnosis-related group that has maximum hospitalization and expenditure.  3. To make sure that there is no malpractice, the agency needs to analyze if the race of the patient is related to the hospitalization costs.  4. To properly utilize the costs, the agency has to analyze the severity of the hospital costs by age and gender for the proper allocation of resources.  5. Since the length of stay is the crucial factor for inpatients, the agency wants to find if the length of stay can be predicted from age, gender, and race.  6. To perform a complete analysis, the agency wants to find the variable that mainly affects hospital costs.',NULL,'R',1,1,0,0,1,NULL,NULL,1355,0,0,2020),
