	(357459371,'Breast-Cancer-Decision-Tree-model','arif420566/Breast-Cancer-Decision-Tree-model',10186074,'https://github.com/arif420566/Breast-Cancer-Decision-Tree-model','Diagnosing a patient with breast cancer requires multiple steps. As given by MayoClinic, the steps are as follows: breast exam, mammogram, breast ultrasound, removing a sample of breast cells for testing (biopsy) and breast magnetic resonance imaging (MRI). Understanding the result from all of these sources to analyze is very time-consuming. With human errors, these predictions might not be very accurate. Therefore, our team came up with a novel way to detect breast cancer using machine learning. Utilizing the Wisconsin Breast Cancer and IBM SPSS, we created a decision tree module that can assist researchers in automating the process of determining which tissues are malignant and benign. We use the decision tree as a classifier to determine what tissue is malignant or benign. Before we jump into the decision tree, we must first characterize what is considered to be benign or malignant. ',NULL,NULL,0,0,0,0,1,NULL,NULL,NULL,0,0,2021),
