	(394884235,'Healthcare-cost-analysis-R','Waleed889/Healthcare-cost-analysis-R',47872334,'https://github.com/Waleed889/Healthcare-cost-analysis-R','BUSINESS Healthcare nationwide survey of hospital costs conducted by the US Agency for Healthcare consists of hospital records of inpatient samples. The given data is restricted to the city of Wisconsin and relates to patients in the age group 0-17 years. The agency wants to analyze the data to research on the healthcare costs and their utilization. Attributes Description: AGE - Age of the patient discharged FEMALE - Binary variable that indicates if the patient is female LOS - Length of stay, in days RACE - Race of the patient (specified numerically) TOTCHG - Hospital discharge costs APRDRG - All Patient Refined Diagnosis Related Groups Analysis to be done: 1. To record the patient statistics, the agency wants to find the age category of people who frequently visit the hospital and has the maximum expenditure. 2. In order of severity of the diagnosis and treatments and to find out the expensive treatments, the agency wants to find the diagnosis-related group that has maximum hospitalization and expenditure. 3. To make sure that there is no malpractice, the agency needs to analyze if the race of the patient is related to the hospitalization costs. 4. To properly utilize the costs, the agency has to analyze the severity of the hospital costs by age and gender for the proper allocation of resources. 5. Since the length of stay is the crucial factor for inpatients, the agency wants to find if the length of stay can be predicted from age, gender, and race. 6. To perform a complete analysis, the agency wants to find the variable that mainly affects hospital costs.',NULL,'R',0,0,0,0,1,NULL,NULL,1586,0,0,2021),
