	(489261305,'fictional-octo-carnival','ChandniSneha/fictional-octo-carnival',105042218,'https://github.com/ChandniSneha/fictional-octo-carnival','The Dubliners of American Gothicthats how Stephen King referred to Ray Bradburys first book, the little-known 1947 short-story collection, Dark Carnival. Theres good reason few readers, even those well versed in Bradburys work, are unfamiliar with Dark Carnival: Arkham House, a small press out of Sauk City, Wisconsin, published the book in a modest run of 3,112 copies; the book went out of print just a few years later. Besides a pricey limited-edition reprint in 2001, Dark Carnival exists as a literary apparition.  And yet many people have read some of Dark Carnival without knowing it. In 1955, Ballantine Books published the now-classic collection of Bradburys gothic horror, The October Country, which celebrated its sixtieth anniversary on October 25, and many of the stories in the collection are reworkings of tales from Dark Carnival. When given the chance to rerelease the out-of-print collection in 1955, Bradbury seized the opportunity to revisit his first book and correct the things he deemed inadequate. (Ever the perfectionist, Bradbury was, throughout his career, often discontent with calling a book done, even after its publication.) He rewrote a number of stories, made light revisions on others, cut twelve tales altogether, and added four new ones to round out the collection. The stories Bradbury discarded he thought too weak, too violent, or too primitive, and not representative of where he was as a writer at that moment.',NULL,NULL,0,0,0,0,1,NULL,NULL,NULL,0,0,2022),
